import React,  {useEffect} from "react";
import {useSelector, useDispatch} from "react-redux"
import "../css_styles/Tourisms.css";
import TouristCard from "../components/TouristCard";
import Footers from "../components/Footers";
import Banners from "../components/Banners";
import Categories from "../components/Categories";
import CelebCarousel from "../components/CelebCarousel";
import tourismsListAction from "../components/advertisAction";
import Loaders from "../components/Loader";
import ErrorMessage from "../components/ErrorMessage";

const celeb = {
  title: "title",
  urlToImage:
    "https://staticg.sportskeeda.com/editor/2021/11/caca5-16370851386444-1920.jpg",
  description: "description",
  author: "author",
  content: "content",
};
const Tourisms = () => {

  const dispatch = useDispatch();
  const tourismsList = useSelector((state) => state.tourismsList);
  const {
    error    :listTourismsError,
    loading  :listTourismsLoading,
    tourismss:listTourisms
  } = tourismsList

  useEffect(() => {
    dispatch(tourismsListAction)
  })

  return (
    <div>
      <CelebCarousel celeb={celeb}/>
      <Banners/>
      <Categories/>
      <div className="tourist_screen">
      <div className="tourist_event">
          Hi
        </div>
        <div className="tourist_main">
          <TouristCard celeb={celeb} />
        </div>
        <div className="tourist_event">
          Hi
        </div>
      </div>
      <Footers/>
    </div>
  );
};

export default Tourisms;
